  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Hutton Lake National
  Wildlife Refuge outlines Refuge accomplishments from September to December of 1957.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, mammals, raptors, and fish- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing and commercial
  fishing. The public relations section of the report describes recreational uses,
  Refuge visitors, and Refuge participation. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
